import React from 'react';
import MyPosts from './Myposts/MyPosts';
import ProfileInfo from './Myposts/ProfileInfo/ProfileInfo';
import classes from './Profile.module.css'

const Profile = (props) => {
  let posts = [
    { message: "Congratulation!", like: "999999999999999999999999999999999999999999999999999999999999999999999999999999999999" },
    { message: "YOU'VE DONE IT!", like: "999999999999999999999999999999999999999999999999999999999999999999999999999999999999" },
  ]
  return (
    <div className={classes.profile}>
      <ProfileInfo />
      <MyPosts posts={posts}/>
    </div>
  );
}

export default Profile;
